css:
.notebook-wrapper {
  background-color: #21252b;
  pointer-events: none;
}
.notebook-editor {
  position: relative;
  height: 100%;
  overflow: hidden;
}
.notebook-editor .notebook-toolbar {
  pointer-events: all;
  position: absolute;
  width: 100%;
  top: -1px;
  left: 50%;
  transform: translateX(-50%);
  padding-top: 5px;
  padding-bottom: 5px;
  text-align: center;
  background-color: #282c34;
  border-bottom: 1px solid #181a1f;
  box-shadow: rgba(87, 87, 87, 0.2) 0 4px 5px 0;
  z-index: 100;
}
.notebook-editor .notebook-toolbar button {
  display: inline-block;
  background-color: #353b45;
}
.notebook-editor .notebook-toolbar button::before {
  margin: 0;
}
.notebook-editor .notebook-cells-container {
  pointer-events: all;
  height: 100%;
  width: 100%;
  overflow-y: scroll;
  padding: 50px 15px;
}
.notebook-editor .redundant-cells-container {
  margin: 0 auto;
  background-color: #21252b;
  box-shadow: rgba(87, 87, 87, 0.2) 0 0 12px 1px;
}
.notebook-editor .notebook-cell {
  width: 100%;
  padding: 10px;
  margin-bottom: 20px;
  display: flex;
  flex-direction: row;
  border-radius: 2px;
}
.notebook-editor .notebook-cell .cell-main {
  flex: 1;
}
.notebook-editor .notebook-cell .execution-count-label {
  width: 70px;
  margin-right: 5px;
  margin-top: 2px;
  flex-basis: auto;
  flex-grow: 0;
  font-size: 12px;
  text-align: right;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-weight: 500;
  color: #282c34;
}
.notebook-editor .notebook-cell .cell-input {
  border: 2px solid #282c34;
  border-radius: 2px;
  min-height: 3em;
  padding: 10px;
}
.notebook-editor .notebook-cell .cell-input.is-focused {
  border: 2px solid #3e4451;
}
.notebook-editor .notebook-cell .cell-display-area {
  margin-top: 10px;
  padding: 0 10px;
  max-height: 80vh;
  overflow-y: scroll;
  overflow-wrap: break-word;
  font-size: 14px;
  background-color: #fff;
}
.notebook-editor .notebook-cell .cell-display-area * {
  font-family: monospace;
}
